import React from "react";

function Card(props) {
  return (
    <div
      id="pokemon-item"
      onClick={() =>
        this.props.event !== "not"
          ? (e) => {
              this.props.onClick([
                {
                  id: props.id,
                  name: props.name,
                  imgUrl: props.imgUrl,
                  HP: props.HP,
                  ATK: props.ATK,
                },
              ]);
            }
          : (e) => e.preventDefault()
      }
    >
      <img src={props.imgUrl} alt={props.name} />
      <p> {props.name}</p>
      <p>{`HP: ${props.HP}   ATK: ${props.ATK}`}</p>
    </div>
  );
}
export default Card;
